sys_variable_value.value:
(function(outputs, steps, stepResult, assertEqual) {
    describe('Count of sys_app_module records', function() {
        it('has not change since tests were created', function() {
            var gaSysAppModule = new GlideAggregate('sys_app_module');
            gaSysAppModule.addQuery('application.title', '=', 'Drink Management');
            gaSysAppModule.addAggregate('COUNT');
            gaSysAppModule.query();
            var expected = '11';
            var count = 0;
            if (gaSysAppModule.next()) {
                count = gaSysAppModule.getAggregate('COUNT');
            }
            expect(count).toBe(expected);
        });
    });
})(outputs, steps, stepResult, assertEqual);
jasmine.getEnv().execute();
